import React from 'react';
import styled from 'styled-components';
import ResumeCareer from './ResumeCareer';

function ResumeList() {
	return (
		<ComponentWrapper>
			<ResumeCareer
				title="경력"
				content={`
                • 담당하신 업무 중 우선순위가 높은 업무를 선별하여 최신순으로 작성해주세요.
                • 신입의 경우, 직무와 관련된 대외활동, 인턴, 계약직 경력 등이 있다면 작성해주세요. 
                • 업무 또는 활동 시 담당했던 역할과 과정, 성과에 대해 자세히 작성해주세요. 
                • 업무 성과는 되도록 구체적인 숫자 혹은 [%]로 표현해주세요!
                • 경력 조회 후 기업명이 실제와 다른 경우, 부서명/직책 란에 원하시는 기업명을 작성해주세요.`}
			/>
			<ResumeCareer />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin-bottom: 20px;
	.resumecontentlist-body-btn-add {
		width: 100%;
		padding: 30px 0;
		display: block;
		font-size: 18px;
		font-weight: 600;
		text-align: left;
		border: none;
		border-radius: 0;
		color: #36f;
		font-family: inherit;
		background-color: transparent;
		border-bottom: 1px solid #f1f1f1;
	}
	.resumecontentlist-header {
		padding: 40px 0 6px;
		font-size: 16px;
		font-weight: 500;
		color: #3b3d40;
		border-bottom: 1px solid #bababa;
	}
	.resumecontentlist-guide {
		white-space: pre-wrap;
		padding: 10px;
		background-color: #f3f9fe;
		font-size: 12px;
		line-height: 1.42;
		letter-spacing: normal;
		color: #666;
		margin-top: 10px;
	}
	.banner {
		display: flex;
		align-items: center;
		width: 100%;
		height: 70px;
		padding: 0 20px;
		border-radius: 3px;
		margin: 10px 0 20px;
		background: #f7f7f7;
		cursor: pointer;
	}
	.banner-content {
		display: flex;
		align-items: center;
		justify-content: space-between;
		width: 100%;
		font-size: 15px;
		font-weight: 500;
		line-height: 18px;
		color: #333;
	}
	.banner-content-text {
		display: inline-flex;
		text-align: left;
		p + p {
			margin-left: 2px;
		}
	}
	.banner-content-btn {
		display: flex;
		align-items: center;
		font-size: 14px;
		font-weight: 700;
		line-height: 17px;
		color: #36f;
		> svg {
			margin-left: 5px;
		}
	}
`;

export default ResumeList;
